import React, { Component } from 'react'
import styles from "./carousel.module.css";

export class Card extends Component {


    render() {
        return (
            <div className={styles.card}>
            <img className={styles.carouselImg} src="https://picsum.photos/200/300" />
            <div className={styles.text-overlay}>Design & Engineering</div>
          </div>
        )
    }
}



export default Card
